import React, { useState } from "react";
import "./LandlordDashboard.css";

const LandlordDashboard = () => {
  const [houses, setHouses] = useState([
    {
      id: 1,
      image: "house1.jpg",
      location: "Nairobi, Kilimani",
      category: "One-Bedroom",
      price: 35000,
      description: "Spacious one-bedroom apartment with modern finishes.",
      paymentStatus: "Paid",
      approvalStatus: "Approved",
      bookings: [
        { client: "John Doe", contact: "+254712345678", date: "2024-03-10" }
      ]
    }
  ]);

  const [newHouse, setNewHouse] = useState({
    image: "",
    location: "",
    category: "",
    price: "",
    description: ""
  });

  const handleInputChange = (e) => {
    setNewHouse({ ...newHouse, [e.target.name]: e.target.value });
  };

  const handleImageUpload = (e) => {
    const file = e.target.files[0];
    setNewHouse({ ...newHouse, image: URL.createObjectURL(file) });
  };

  const handleAddHouse = () => {
    if (!newHouse.image || !newHouse.location || !newHouse.category || !newHouse.price || !newHouse.description) {
      alert("Please fill in all fields before submitting.");
      return;
    }

    alert("You need to pay before your house goes live.\nSend money via M-Pesa to 0710464858.");
    setHouses([...houses, { ...newHouse, id: houses.length + 1, paymentStatus: "Not Paid", approvalStatus: "Pending", bookings: [] }]);
    setNewHouse({ image: "", location: "", category: "", price: "", description: "" });
  };

  return (
    <div className="landlord-dashboard">
      <h2>üè† Landlord Dashboard</h2>

      {/* ‚û§ Section 1: Add New House */}
      <div className="house-form">
        <h3>Add New House</h3>
        <label>Upload Image:</label>
        <input type="file" onChange={handleImageUpload} />

        <label>Location:</label>
        <input type="text" name="location" value={newHouse.location} onChange={handleInputChange} placeholder="Enter location" />

        <label>Category:</label>
        <select name="category" value={newHouse.category} onChange={handleInputChange}>
          <option value="">Select Category</option>
          <option value="Single Room">Single Room</option>
          <option value="One-Bedroom">One-Bedroom</option>
          <option value="Bedsitter">Bedsitter</option>
        </select>

        <label>Price (KSh):</label>
        <input type="number" name="price" value={newHouse.price} onChange={handleInputChange} placeholder="Enter price" />

        <label>Description:</label>
        <textarea name="description" value={newHouse.description} onChange={handleInputChange} placeholder="Write short details about the house"></textarea>

        <button onClick={handleAddHouse} className="submit-button">Submit House</button>
      </div>

      {/* ‚û§ Section 2: View All Houses */}
      <h3>Your Listed Houses</h3>
      {houses.length === 0 ? (
        <p>No houses added yet.</p>
      ) : (
        <div className="house-list">
          {houses.map((house) => (
            <div key={house.id} className="house-card">
              <img src={house.image} alt={house.category} className="house-image" />
              <p><strong>Location:</strong> {house.location}</p>
              <p><strong>Category:</strong> {house.category}</p>
              <p><strong>Price:</strong> KSh {house.price.toLocaleString()}</p>
              <p><strong>Description:</strong> {house.description}</p>
              <p><strong>Payment Status:</strong> {house.paymentStatus}</p>
              <p><strong>Approval Status:</strong> {house.approvalStatus}</p>
            </div>
          ))}
        </div>
      )}

      {/* ‚û§ Section 3: Booking Requests */}
      <h3>Bookings for Your Houses</h3>
      {houses.some(house => house.bookings.length > 0) ? (
        houses.map(house => (
          house.bookings.length > 0 && (
            <div key={house.id} className="booking-card">
              <h4>{house.category} - {house.location}</h4>
              {house.bookings.map((booking, index) => (
                <p key={index}><strong>Client:</strong> {booking.client}, <strong>Contact:</strong> {booking.contact}, <strong>Date:</strong> {booking.date}</p>
              ))}
            </div>
          )
        ))
      ) : (
        <p>No bookings yet.</p>
      )}
    </div>
  );
};

export default LandlordDashboard;
